INSERT INTO suggestions VALUES ('5fbbb9ec-a4eb-4c03-a9d3-97013ccbd0e5', '[与上一节课相比有小进步, 基础知识很扎实, 主动学习的能力很强, 主动复习巩固的热情很高, 掌握一定的技巧, 做题速度很快，整体准确率很高，但对于过程复杂的题目，会粗心把简单的式子算错]', '[可以多与老师互动，表达自己的看法, 要多学习将掌握的知识与技巧适当地结合, 多配合老师完成相关习题 ，加快进度, 要多学会从已学会的题目中找规律, 练习图形选择题时一定要注意先观察！不要着急算；要多学习逆推法，反向计算, 切忌焦躁，难题一定要慢慢来，尽量把自己会的都写对]');
