INSERT INTO suggestions VALUES ('adfdad63-4dde-4765-955c-9ff1a9b0bb1c', '[听讲认真，专注度高。, 基础知识掌握扎实，推论或公式的运用技巧较欠缺。, 下次上课的题目会提前看并尝试解答。, 会主动复习做过的题目。, 总体不错，考试时心态调整方面可以更好。, 做题速度不是很快，准确率较高。]', '[可以更多的积极互动以营造较轻松氛围，多讲一些自己的想法。, 在理解基本概念的前提下尝试自己推导公式或者推论来加深理解。, 考虑到空闲时间有限，解答时也可以不必计较于具体计算过程，只需对解题思路有清晰的把握，列出主要的计算式即可。, 可以对同一类的题目进行思路解法的归纳总结。, 学会取舍，尽自己最大力量解答所有的题目，但不是一定能全部做出，所以还要注意考试时心态的调整，比如可以有积极的自我心理暗示。, 在保证正确的前提下提高做题速度，多进行草稿演算有助于清晰思路，另外可以划出题目中的关键信息来帮助做题。]');
