INSERT INTO suggestions VALUES ('85901781-3018-4851-a6ae-004a76eaf0e5', '[上课专注度很高，基本能全神贯注，认真思考每个问题，看每道题。但思考局限于惯性思考，深度思考稍有欠缺。, 基础知识体系没有大的问题, 主动预习情况较好, 复习巩固不是很及时，有部分知识点有点淡忘, 考试技巧基本可以，但不成体系，不太全面, 做题速度非常快，准确度有待提高]', '[对于基础不错的雷汶韬来说，建议就是在引导下多做深度思考，可能会达到学会一道题掌握一类题的效果。触类旁通，举一反三对于提升汶韬很重要。, 该做好的是查漏补缺，熟悉各个知识点，能更好地应用它们, 对知识的渴求度比较高，衷心希望接受新的知识，这点希望能继续保持, 主动复习巩固实在全面了解自己的前提下进行的，今后将教习发现自己漏洞的一般方法，告诫及时进行不熟悉知识点的温习。, 今后这点将是主要教学点，将会有体系的考试技巧教于汶韬，包括计算技巧、解答技巧、证明技巧、猜答案技巧、解方程技巧等。, 在保证准确率的前提下再进行速度训练才会有大的进步。]');
INSERT INTO suggestions VALUES ('adc9a87a-a3f8-4ddc-87f8-5be81bcbe18e', '[专注度有所提高，特别是之前和孩子沟通上课时沉下心来不玩手机后，基本上课时不会再分心玩手机了, 可能中间一段时间的缺课，对浮力方面知识掌握不太好, 月初表现较好，后面表现较差, 对物理学过的知识复习的较少，主要是在授课时候帮助复习，自主复习的可能较少, 有一定进步, 尚需提高]', '[保持专注，同时还能够在上课时开动脑筋，多多思考（会侧重更多地与孩子之间的互动）, 后面还要侧重于浮力知识的教授，不仅仅知道大体框架，还要对相关计算有一定的敏感度；, 后面还要多方面提醒孩子预习，适当给与一定的鼓励和奖励。此外，兴趣也是很重要的一方面，后面也会更多给孩子展现物理有趣的东西，鼓励孩子自主学习；, 转变孩子学习物理的习惯，积极和他沟通：了解老师布置的题目应该独立完成，结合平时习题来更便捷地复习；, 对于考试题目，不管怎样，保持耐心把所有题目的方法、考察点、结题技巧、与书本的联系等方面和孩子较全面地探讨, 还是需要经常提醒下孩子保持细心，对待物理的问题很多时候不能太过大意]');
