INSERT INTO suggestions VALUES ('56fc2b53-5c0f-48a5-a0a5-7b5565a31e11', '[认真程度有所提高，但仍然要注意保持好状态, 基础知识掌握一般，扩展知识掌握还需提高, 情况一般, 课后适当做规定的题目, 需要锻炼考试的心态, 速度还可以，准确率需提高]', '[课前一定要休息好，上课时拿出十佳的状态, 自己多做练习, 课前可以自己先复习一遍需要上课的知识，疑难点可在上课时提出来, 有针对性的做题, 考试字迹要工整，要有答题规范, 先保证准确率，再提高速度]');
INSERT INTO suggestions VALUES ('af67ed6e-fdff-43cc-8ed7-4319863db54b', '[听课比较专注, 能量守恒基础知识掌握可以，但是不够深入, 五一假期这一阶段主要在巩固所学内容，适当延伸了一些综合题内容, 比较主动，任务会按时完成，但是预习做的不够, 做题速度稍微提升, 准确率有待加强]', '[对物理的一些综合性题目要多加练习, 多做题！！, 对一些常见题型进行总结，平时多上点心, 课前预习，课后复习，之后会学的比较轻松, 可以试着按照考试时间做卷子, 考试时先易后难，一步一步来]');
