INSERT INTO suggestions VALUES ('e01faca6-c227-4fca-9346-624b5dc95fd2', '[学生上课逐渐更加专注，注意力更加集中。, 语文：学生在古诗词赏析方面的读题破题能力、答题方法技巧以及答题格式均掌握较好。\n历史：对中国近代史有了初步的了解。, 能够提前预习下节课所讲内容。, 能够完成课上布置的任务，及时复习课上所讲内容。, 能够将上课所讲古诗词答题方法熟练运用到考试中，这一点在近期考试中有所体现。, 做题速度较快，准确率较高。]', '[上课应全神贯注，不要容易走神。, 下个月将会针对现代文阅读进行讲解。\n对中国近代史进行详细讲解。, 希望学生能够继续保持。, 希望学生能够及时完成任务，多抽课余时间复习。, 希望学生能够继续保持。, 在确保速度的同时也要提高准确率。]');
INSERT INTO suggestions VALUES ('b4547bae-24c0-44fa-8b8f-1b896056da64', '[ 与老师的配合不错，课上讲解的内容理解得很快，但存在偶尔开小差的情况。, 数学：知识点掌握地还不错，但一些技巧性的知识点了解较少，导致做题速度上不来\n物理：基础知识掌握地较为混乱，主要是没有弄清楚原理所导致的。\n英语：薄弱环节在完型填空和阅读理解，对于前后文关联的细节题掌握不佳，语感也还有待加强。, 这点做的不好, 着点也需加强，在本月的学习中出现这么一个状况：在物理上课的时候讲解过了几道题在孩子期中考试的时候恰好考到了，仅仅只是数据做了修改，而孩子却没有做对。, 技巧掌握不佳, 做题速度快，准确率不高]', '[希望孩子能专注一些，而老师也要更加合理地安排休息时间，以提高效率。, 数学：以做题为主，配合题目讲解一些解题的技巧\n物理：现将基础知识讲解透彻，在此基础上做一些题目巩固知识点即可\n英语：以完形填空和阅读理解的训练为主, 希望能将老师提前布置的作业完成，这样老师来上课的时候就能够直接讲解题目了，这样会使上课的效率更高。, 主动复习课上讲解的内容，并结合布置的复习巩固作业从而完全掌握课上讲的东西。, 做完题后思考解题的各种方案，并思考最快的解法, 孩子做题有时会不经思考就写出答案，这往往是主观以为的结果，在接下来的学习中，希望控制自己的做题时间，严格限制做题太快的情况，倒逼自己思考地严谨一些。]');
