INSERT INTO suggestions VALUES ('61ba1e39-053c-47ce-999f-0bcddac551df', '[听课较为认真，学习态度好, 基础知识偏弱，概念掌握有问题, 没有主动预习, 能够完成布置的作业，但是缺少反复记忆, 能够较好的掌握考试技巧，懂得适当放弃, 速度有待提升，选择题准确率较高，大题准确率有待提升]', '[继续保持，尽量跟上老师思路, 多复习基础知识，接下来会帮助其掌握基础知识的基础上，逐步加深难度, 希望学生平时多花时间在记忆化学基础知识和方程式等方面, 完成所有基础知识的复习后，会准备一些试卷作为课后作业，以此督促学生在平时多练习化学, 考试技巧掌握的不错，之后会教学生如何在考场分配做题时间，以及适当放弃一些难题, 速度及准确率都与知识掌握程度有关，多刷题才能在这两方面进步，之后会适当在课堂中增加做题训练]');
