INSERT INTO suggestions VALUES ('88206b1a-1b0d-45c4-8e49-f9f7e01568b4', '[本阶段学生的上课专注力比上一阶段强,在学习积极性方面也有所提高,在强制收手机后学习效率明显提高。, 这三次课程的主要内容是八下:一次函数和正比例函数,八上：一元一次不等式的求解和一元二次方程组，另监督并考察学生生物地理背诵内容，对于基础概念和题目，学生基本掌握，但对于题目的变形和复杂化，需要加强练习。, 关于第三次课程监督并考察学生生物地理背诵内容时，学生能准确背出要求背诵内容，说明学生对于记忆性知识点只要努力就可以完成，故后阶段我准备整理初一至今所学的重要公式进行强制背诵。, 主动复习巩固方面学生做的不是很到，平时做题不多，故需要培养学生的做题兴趣。, 简单题目技巧基本掌握，能快速求得结果，但对于多考点问题，还需综合知的运用，这需要大量做题才能做到孰能生巧。, 学生对于正比例函数和一次函数有一点基础，但做题时仍有粗心的毛病，有时做题会把 题目条件写错导致结果错误。]', '[预计下阶段继续保持不让学生碰手机,尽量缩短学生上课期间去卫生间的时间.端正学习态度。, 预计下阶段教授一元二次方程和一元二次函数内容，紧跟学校教学内容，使学生能够掌握初中的重点内容——函数，在学习完基本内容后，大量做题，以达到掌握的效果。, 在记完公式后要求默写，并整理出公式对应的题目加以理解，明白每个公式的具体应用。, 学生的惰性较大，平时做题不多，所以准备下阶段练习完公式所对应的题目后会准备相应习题强制进行巩固复习。, 着重强调重要考点，大量做题找感觉, 特别欣慰的一次课程体验是：在学生经历集中的状态下讲完知识点后让学生做题，学生对于中下等难度的题目能直接选对答案，说明对于教授的内容已完全掌握并能达到熟练应用的程度，所以希望能和学生共同进步，多一点这样的场景。]');
INSERT INTO suggestions VALUES ('ac70b329-5dda-4ef2-a4fe-2fc3efc08f52', '[有所进步，仍需努力, 有所进步，仍需努力, 有所进步，仍需努力, 有所进步，仍需努力, 有所进步，仍需努力, 有所进步，仍需努力]', '[希望学生好好学习, 希望学生好好学习, 希望学生好好学习, 希望学生好好学习, 希望学生好好学习, 希望学生好好学习]');
