INSERT INTO suggestions VALUES ('82921c6c-9b65-4c04-8a54-d6acf62dd60b', '[一直表现很好，很认真听课，跟着老师的思路走。, 对于数学的函数解题方法有了很大的提升，熟练了做题过程，还有几何证明方面也了解了基本思路，对于物理电学方面能够根据公式解题, 有待加强。, 按时完成作业，有很好的态度。, 进步较大。, 做题速度很好，但准确率偏低，有待加强。]', '[, 数学方面：对学生针对一些中考常见题型进行练习，重点放在函数·几何方面，物理：提问必背公式，对电学加强练习。, , , 会教授给他一些应试技巧，比如考试时不能死坑难题，不会的就先放放。, ]');
INSERT INTO suggestions VALUES ('30118fb8-d767-4e5d-aae0-0dd538a0f002', '[专注度保持良好, 基础知识掌握全面，单词积累较为薄弱, 尚未养成, 有考前复习的习惯, 考试基本技巧有所掌握，但语文和英语部分题型掌握有待提高, 做题速度较高，语文准确度较低]', '[继续保持, 增加语文课外知识积累，单词及语法知识积累, 引导养成良好的预习习惯, 将复习习惯带入学员的日常学习当中, 加强对语文文言文，古诗词技巧训练，英语五选四训练, 帮助学员多积累多练题，提高语文准确率]');
INSERT INTO suggestions VALUES ('02251cdf-ea7d-464a-9d6a-79b6dd18ae33', '[有的时候上课发困，注意力会受到影响。, 讲过的题基本上都可以掌握。, 现在正在一轮复习，复习进度跟上学校老师的步伐，能不落下就很好。, 每次上课前会复习巩固上节课讲过的知识点和错题，文理基本上可以掌握。, 考试重点平常上课的时候会经常讲到，文理也有认真地在听，掌握的很好。, 做题速度相对较慢是因为刚开始复习这一部分内容，但正确率很高。]', '[中午休息好，下午上课的效果会更好。, 平常学习中及时的翻笔记以及背诵记忆一些物理化学中必要的知识点，这很重要。, 一轮复习关键在于对知识点的掌握，这一阶段要紧跟学校老师的进度，不要落下。, 上课前把上个礼拜讲过的最好看一遍，复习一下，下一次上课会提问上节课讲过的错题和知识点。, 记忆一些必要的快速做题的方法和公式。, 建立错题本，把每周做错的题目写在本子上。]');
INSERT INTO suggestions VALUES ('f74d2d41-e8e1-4690-bbb7-296a259b25df', '[比较专注，偶尔开小差要老师提醒, 对八上知识点掌握更好一些了, , 作业按时完成，但缺乏自己的总结,   知道要适当放弃难题，有进步, 做题速度提升了，但准确率提升不明显，尤其是大题]', '[上课时刻关注学生的状态，及时提醒，适当休息, 让学生把要背记的内容都掌握牢固，然后关于力学电学难题要把公式及其适用范围搞清楚, , 帮助学生总结归纳一些知识的，形成体系, 摆正考试心态，避免粗心，基础题不丢分, 平常课堂作业练起，训练孩子审题和演算能力]');
INSERT INTO suggestions VALUES ('6cb78e7a-1cac-4086-9a8e-9930572979cd', '[听课专心, 不够灵活, 主动学习, 能完成交给的课后题, 基础掌握较好, 简单题不错，难题花费大量时间]', '[较长题目注意审题, 注意各知识点的联系, 加强针对性练习, 有针对复习, 难题无从分析, 有针对性根据讲授内容练习难题]');
INSERT INTO suggestions VALUES ('65722f07-020d-43dd-86ab-b2cccc9d2d99', '[听课较之前更加专注认真, 对基础知识掌握更为牢靠，并解决难题更得心应手，不至于没法下笔，学习能力有了一定明显的提高。, 为初三复习阶段，无明显变化, 对知识掌握越来越牢固，复习巩固良好, 考试应试技巧得到明显提高，考试成绩处于稳步上升阶段, 都有所提高，做题速度很快，但准确率还待较大提高。]', '[保持上课认真的状态，继续加油。, 勤加复习巩固所学，保证知识无缺漏, 建议学生在课下尽量多完成作业以及能提前多预习一下课上将要教授的内容，以便提高课上效率, 继续保持当前学习状态，冲刺中考, 在接下来的时间提高效率，专注于考试能力方面的解题技巧传授，决胜中考。, 多进行专题的训练，将教授的应试方法应用于考试中，真正的提高应试能力。]');
INSERT INTO suggestions VALUES ('2d36d03f-4606-4b0c-954e-789513b65258', '[进入状态变快, 掌握不牢，遗忘快, 无, 经常说但无执行, 方法掌握不牢，会的题不认真，应用题空题多, 速度还可以，准确率需提高]', '[专注度较差，希望上课认真听讲，跟着老师节奏走，认真回答问题，跟着做必要的练习, 多次重复，加强练习, 不做太多要求, 课下主动做必要复习，回看总结的错题及做题方法, 会做的题再细心，不会的也不要空题，讲的做题方法及考试技巧多练，掌握应用, 巩固基础及做题方法，将不会的题型消灭，提高准确率]');
INSERT INTO suggestions VALUES ('4a73e9f6-985c-498f-bc22-858b495a6e6e', '[上课比以前注意力更加集中，但偶尔出现哼歌，这时容易分心。, 诗词赏析、现代文阅读以及作文均已讲解且复习过一遍，学生掌握情况较好。, 较好, 较好, 答题套路掌握较好, 一般]', '[上课一定要集中注意力，不要弄小动作。, 重点放在对作文素材的分析上，不能想当然答题。, 预习完毕, 复习所做题目与答题技巧。, 对于难题，要牢牢抓住中心思想。, 提高现代文阅读能力，缩短时间。]');
INSERT INTO suggestions VALUES ('261bab0f-529b-4681-8870-14a45ecfb4a7', '[情况较好，主动做笔记, 有进步, 完成一般, 一般, 一般, 较差]', '[应加强与老师的沟通交流，有问题要及时反映。, 近期主要抓背单词，养成良好的背单词习惯并提高效率。, 要按时完成老师布置的作业, 课后复习不能潦草的看，要看的深入仔细，发现新问题。, 从做题中培养语感, 前提要掌握知识点，然后通过加大题量培养做题速度]');
INSERT INTO suggestions VALUES ('6162581d-ec81-4895-b7c5-c082a737beac', '[上课较认真，听讲的同时能提出自己的疑惑。, 讲解的练习册上的错难题掌握得很好。, 由于学习时间有限，超前预习方面有所欠缺。, 跟上学校老师步伐的同时，自己要学会多看以前的错题，这一点比较欠缺。, 计算题总是会不小心算错。, 速度较慢，但正确率较高。]', '[学会好好补课的时间，问一些在学校这个礼拜没听懂的知识点等。, 错题多看，难题多练，不留下知识漏洞。, 老师讲新知识点前最好能抽出时间看看上练习册上列出的知识框架。, 不断复习巩固错题本上的错题以及一些必记的公式等。, 建议在草稿纸上进行计算时写计算式要清晰，一步一步来，不要因跳步而计算错误。, 多做题，多掌握一些快的做题技巧。]');
INSERT INTO suggestions VALUES ('103ab25d-e199-4df3-beb4-2afdef748ac8', '[13号的那一次上课听讲完全不在状态，感觉他很烦躁，其他几次就显得比较好，不足的是喜欢讲话，讲一些跟上课无关的话题。, 主要的基础知识掌握的还可以，但是有些小细节掌握的不够好，经常会忘记以前学的知识。, 偶尔会超前看一下书。, 没有主动复习的习惯，才会导致经常忘记以前的知识点。, 考试技巧不够，不会一些简便的方法。, 速度还可以，但准确率不够高。]', '[希望能改掉上课总是扯其他东西的习惯，更专注于听我讲的东西。, 希望能多注重一下细节上的东西，把那些细微的知识点掌握到位。, 最好能主动预习，但是不希望主动预习之后就不听老师讲课了。, 要经常复习，或者多看看以前做的题目来巩固知识。, 希望能多听老师讲作业题，学习一下老师的简便方法。, 打草稿不要太随意，这样在一定程度上可以提高准确率。]');
INSERT INTO suggestions VALUES ('0f90dba2-6d85-4053-bcc3-1c613cbc08a4', '[前半段上课比较认真专注，但上到后半段就显得很疲惫，上课听讲的效率也不高了。, 在二次函数这一块掌握的真心不是很好，有很多小的知识点都忘记了。, 基本不会主动预习，超前学习。, 在我看来基本没有复习巩固过。, 考试技巧缺乏，没有掌握什么快速解题的技巧。, 速度不够快，准确率也不够高，经常会算错题目。]', '[我会在中间多掺插一些休息时间，还是希望能认真专注的听完。, 希望能多背一背这些公式，特点什么的，这样才能记得比较好。, 还是尽可能的预习一点，这样学起来才比较方便。, 还是要经常复习的，不然之前学习的知识点，公式就会全部忘记的。, 多听老师讲作业，学习一下老师讲的简便方法。, 希望能够打好草稿，这样能降低算错的概率，并且希望能够仔细看题，看完题目再开始做。]');
