INSERT INTO suggestions VALUES ('c10af23c-06ac-474c-9eb3-138e47975a24', '[比起第一个月来，宇航上课更加积极活跃，上课也会时不时问我一些问题，听课专注度较好。, 初二单词，短语的讲解寂静差不多了，但还有不少宇航还未记住，但做题已经有很大提高了。, 宇航会不时主动做一些后面可视的练习，还是比较让我欣慰的。, 主动复习的效果不是很好。, 对于考试技巧这一块宇航掌握的还是比较好的，以期中考试为例，他把阅读和后面作文的技巧基本都用上了，很不错的。, 经过我每次给宇航做题时时间的限制以及催促，宇航做题速度有很大的提高。]', '[接下来，尽量做到上课积极主动，也希望和家长们一起监督宇航，把每次学过的只是复习巩固。, 接下来将针对宇航对于句子结构，一些语法知识的困惑重点突破，集中讲解语法。, 针对每次布置的小作业，会提醒宇航，让家长和我共同监督。, 会每次上课前，带着宇航一起复习上次学过的内容。, 将会在每一次练习中不断重复知识要点，也不断复习之前学过的知识。, 接下来会照之前的，限时训练，期待宇航学习更进一步。]');
INSERT INTO suggestions VALUES ('89256a8f-ccbd-4b30-87d9-51861e68ff74', '[听课专注度高，能够举一反三, 物理知识点大部分掌握了，但是有部分知识点尚掌握牢固, 主动预习积极性尚且不高，不过能够把学会的知识掌握比较好, 复习效果比较好, 技巧掌握较好，并且有自己的方法。, 做题速度快准确率较高（但是还是有粗心的问题）]', '[听课的时候加强自己的思考能力, 记住知识点，并学会应用, 可以适当的提前预习，但前提是要把学过的而知识点掌握牢固, 建议把讲过的错题用错题本总结归纳一下，并思考运用什么知识点及解题技巧来解体, 记住我上课所讲的解题方法，并结合自己的实际来总结一套属于自己的解题方法, 在保证正确率的情况下，做题越快越好（前提是仔细审题不能粗心）]');
