INSERT INTO suggestions VALUES ('6cf95891-d5c6-4f9b-b0a2-8765be50c56f', '[听课情况较差。精神状态不是很好。, 知识点掌握的不是很好，大题更是直接放弃。, 无, 无, 考试技巧掌握的不是很好, 做题速度较慢且准确率不高。]', '[希望能静下心来学习，平常也需要好好休息。, 希望能去尝试一下大题，考试的时候大题占的比例挺高的。多多加油。, 无, 希望能把留下来的卷子认真做一下，不会的圈起来，下次上课的时候讲解。, 希望做题目的时候能打一下草稿，这样更容易理清思路，可能会发现自己没注意到的点从而解出题目。, 好好的看一下物理书，清楚知识点和本学期学到的物理公式。再通过做一些简单的题目熟悉并且掌握这些知识点，然后慢慢提升题目难度，加深印象。并且要学会整理错题本，多多看错题。不要错了看了答案就不看错题了。离期末考试不远了，希望李旭同学能加把劲，在这一个月多一点的时间里，吃一些苦，期末取得好成绩。]');
INSERT INTO suggestions VALUES ('5b21fabd-8130-4d8b-a75c-e0aaf40bd7da', '[听课专注，不走神 , 会备课，准备卷子 , 会提前到授课地点, 主动问问题, 考试基本题型都掌握 , 做题速度明显提升]', '[继续保持专注, 可以多拿不会做的题目来问, 可以在微信上把在学校做的不清楚的题目发给我, 继续保持主动性 , 可以再多做一点题目，加强基础知识的掌握, 把会做的有把握的题目先做啦 ]');
