INSERT INTO suggestions VALUES ('1923c9b8-75c1-4584-b9a6-302079575db2', '[稍微进步，但还是容易三心二意, 单词最差，语法还可以, 没有看到, 无, 改善很多，尤其是字迹, 速度快但是准确率不高]', '[希望家长更加严厉对待，自己要懂得努力, 认真背诵，不能偷懒, 学习三部曲希望养成, 不要把老师的命令当任务去完成，自己珍惜, 坚持下去, 放慢节奏，一心放在题目上]');
INSERT INTO suggestions VALUES ('b36cf4a7-143f-4df9-abc1-34ac93b9de2e', '[有进步, 较好, 不做要求, 做的不够好, 有明显进步, 有进步，还有上升空间]', '[继续保持, 先从基础开始，再慢慢提升难度, 希望能及时把错题发给我, 希望能简单复习一遍讲过的知识框架, 加油，要注意总结啊, 要更细心一些，注意小细节]');
INSERT INTO suggestions VALUES ('e1a249da-047f-4163-ad16-29a1a8cae750', '[大部分时间比较专注，有进步, 掌握了很多单词, 没有主动预习, 没有主动复习巩固, 考试不多，技巧不需要掌握太多, 没有课堂习题，作业只涉及朗读，抄写]', '[学习需要更认真一些，有点偷懒, 多记单词，多花时间练习, 教他预习方法，布置预习作业, 布置作业，家长督促完成, 给他分析以往的卷子，教他答题, 买本练习题练习]');
INSERT INTO suggestions VALUES ('8f45579c-c9e0-4d1c-a6bf-d7d3c226d3db', '[有进步，但并不显著, 基础知识很扎实, 主动学习的动力还不是很强, 主动复习的动力还有待提高, 有明显进步, 准确率和速度都有所提升]', '[要多听老师讲授的方法，不要急着用笔记，要多思考, 掌握基础知识只是一部分，要多学会运用，可多看一些典型题目, 考虑到学生平时作业也很多，不做硬性要求，但要把老师布置的作业完成, 做会题比做多题更重要，不要忙着去做题，要主动把老师讲的复习巩固消化, 基础知识要做到不丢分，后两道大题可以多练习，掌握一定规律，把前两问做出来, 遇到复杂的题目不要急，慢慢算，争取把自己能拿到的分数拿到]');
INSERT INTO suggestions VALUES ('88f2b6a7-e1fb-44cc-83f1-12b4505eb1ac', '[加油加油，祝福祝福, 加油加油，祝福祝福, 加油加油，祝福祝福, 加油加油，祝福祝福, 加油加油，祝福祝福, 加油加油，祝福祝福]', '[加油加油，祝福祝福, 加油加油，祝福祝福, 加油加油，祝福祝福, 加油加油，祝福祝福, 加油加油，祝福祝福, 加油加油，祝福祝福]');
INSERT INTO suggestions VALUES ('3efae5c7-c1e6-40ec-9c8b-717533def101', '[听课不是很认真，手上喜欢玩东西, 单词仍然不够，是最大的漏洞, 没有预习的良好的习惯和态度, 没有巩固的良好的习惯, 还未涉及到考试相关内容, 速度一般，准确率较低]', '[习惯改正很重要, 单词不去记背是无法进行下一步的，还需端正态度，放好心态去看待单词, 还未涉及, 对于错的单词一定要多抄几遍，加深印象，不一定要一次性记住但是需要坚持，需要恒心, 还未涉及到考试相关内容, 必须先克服单词这个关卡]');
INSERT INTO suggestions VALUES ('108e4b87-44f3-4eb8-a94d-1b793fde09e8', '[专注程度有明显进步, 数学基础知识基本掌握；物理基础知识还差很多, 主动学习的劲头很足，但主动预习的能力不够, 老师布置的复习题基本会复习, 数学相比之前掌握了一定的技巧，但物理技巧还不是很扎实, 做题速度有提升，准确率依然有待提升]', '[物理一定注意多练习，多翻书, 数学可以做综合性的套卷；物理仍要做专题，掌握基础知识, 这一块儿主要是物理，物理一定要多预习，做卷子不会的题要先查书, 不要一直等老师强制，自己要主动看不熟悉的题，因为老师留的是学生不会的，很难做到面面俱到, 多看错题，自己琢磨出来的规律记忆更深刻, 会做的题目不要心急，算一步看一步。]');
INSERT INTO suggestions VALUES ('f22f53d3-ca35-404f-b58e-20d99ec75d9e', '[除了最近一次（5月25日晚）之外，从开始以来一直很专注，很认真。积极配合，全神贯注。, 1.基本的初一上知识点有所遗忘，如：\n自然数和正整数的区别\n2.个别细节掌握不是太好，如：\n-（-8）的相反数是多少\n3.书写不太规范，如:\n  6写出来像2\n, 主动预习情况良好, 主动复习和巩固做得不太好:\n1.之前知识点的遗忘比较严重\n2.纠错本的复习也做得不太到位, 考试技巧掌握不太好, 做题速度还是很快的，但准确率不是太高]', '[不论上一次是什么原因，但希望雷汶韬能把以前的状态找回来，积极配合，共同进步。因为接下来的工作量会有点大，可能讲授的内容每次都会增多。临近期末考试，复习前面的知识也即将开始，精神状态好效率才更高。, 初一相关知识和考点已经复习，以后会择机进行复习。细节问题和习惯问题不可急躁，要慢慢改，会以后经常督促和提醒。书写问题也会进行时常纠正和提醒，因为这个确实也不敢疏忽。, 希望继续保持，时间允许的情况下会引导预习和超前学习, 如果感到哪块遗忘严重，我会正片复习那块知识面，这个方法也会教给他，希望他能学以致用。 纠错本的重要性不用多说，我会提醒他考前复习，时常翻阅，纠错的目的是不再犯错，所以这个也会重视起来。, 在上一次期中考试中，竟然有一道填空题没有做，不管时间允不允许，会不会做。以后也会常常提醒他，选择填空题绝对不能空着，因为随便填一个可能会对啊，不填一定不会对。, 会常常提醒他，在保证准确的前提下，再谈速度。因为做的快，但做错了也是无用的，还不如做得慢，准确率稍微高点好。还有他喜欢口算而不是笔算，这样会降低准确率，这个也会经常提醒。几何问题数形结合很重要，不能嫌麻烦而凭空想象，数形结合可以提高准确率和速度。这点在以后的讲述中会经常提醒。]');
INSERT INTO suggestions VALUES ('5e7570b2-2908-49ff-9ba2-3e3c0747364e', '[听课还是和以前一样认真，注意力集中, 基本知识较以前有所提高，但还是不太熟悉，运用不熟练, 预习的习惯还未养成，原因是老师没讲自己提前看的话看不懂并且老师讲了也不一定能完全理解。, 这方面孩子做的不是太好，对以前学的知识遗忘程度稍有严重。, 基本技巧掌握到位，略难的解题思路掌握不是太好。, 审题不是太严密，容易忽略题目条件，计算能力薄弱。]', '[会更多的让孩子主动去算，去画图去理解也可以同时提高孩子的计算能力, 在解题过程中穿插复习相对应的知识点，从而让其加深理解学会灵活运用。, 温故而知新，我会通过前面知识的复习加深对后面即将要学的知识的理解并且让孩子熟悉相关术语与概念，从而不怕预习，让孩子会找问题。, 新知识都是建立在旧知识的基础之上的，所以在后面的学习过程中肯定会遇到前面的知识，从而达到复习效果。, 练习孩子看清题目本质的能力，知道出题者的意图，达到知己知彼，遇题解题的效果。, 勾画题目条件，加强运算能力，运算速度以及运算技巧。]');
