INSERT INTO suggestions VALUES ('e6591c7f-4a23-416c-ba2a-436999725058', '[会有一定的不专心情况出现，但总体态度较好。, 知识点掌握不够，强调过的知识点过一个星期就忘了。, 自主学习能力较差，不会自主预习。, 没有学习动力，对于学习过的知识点没有过复习。, 技巧掌握的不错，但是习惯性蒙题，经常凭感觉猜题。, 做题速度很快但准确率不高，遇到某些较难的题目时经常会直接猜答案或者是看图上的角度直接写]', '[会对学生多进行提问或者引导学生自己写过程，增加她自主学习的动力。, 会有一定的惩罚措施，会让孩子抄写几遍增强记忆。, 每次补习的时候会抽20到40分钟的时间来带孩子进行对下一章节的知识进行预习。, 会花较长时间对本周的学习内容进行复习和整理，不能将现在的课程落下。, 有一定的惩罚，出现此类情况的时候会提出，再犯同样的错误的话，会罚抄5遍, 会进行提醒，但是由于之前的一些老师有一部分不太准确的指导，会尽量指正。]');
