INSERT INTO suggestions VALUES ('537f71c6-0f9e-48f0-8a74-529de4e91d8a', '[听课认真专注，参与度有所提高, 对新知识掌握不太熟练, 由于时间有限，对新知识预习有所欠缺, 由于时间有限，对讲过的知识公式等还没有进行系统的总结与复习, 以知识讲解为主，尚未进行系统的做题技巧总结, 目前对新内容掌握不够熟练，因而速度不太高。准确率方面保持较好]', '[可以多增加些互动反馈, 在掌握基础知识前提下尽量多做练习题，熟练运用所学公式, 高中内容知识深度增加，需要多进行预习, 复习时可以着重进行公式以及推论结论的推导与总结, 做题时可以借助于运动示意图等图示方法梳理思路，有助于更快寻找解题思路, 在保证准确的前提下多做练习题，提高对公式的运用能力，进而提高做题速度]');
