INSERT INTO suggestions VALUES ('d36bac82-743e-40fb-ab06-d99e3a57243b', '[很认真, 很好, 主动预习情况良好，但没有超前学习, 课后主动复习情况良好, 良好，掌握了基本的考试技巧, 做题速度提高，准确率显著提高]', '[下次再接再厉, 题目做得不够, 学会自学，提前学习, 学会在老师的帮助下主动超前复习, 课后仍要勤学苦练, 还是要大量刷题，多做多想多写]');
