INSERT INTO suggestions VALUES ('9d733eb1-c7b5-4390-9c3f-bb70c1bee4bd', '[每节课听课都比较专注，基本不会开小差，偶尔会在课上有点犯困，精力就不太集中。, 二次函数的基本概念、图像性质等内容掌握得比较扎实。但是二次函数和二元一次方程的关系这一类型的题目还待加强。, 因为生地会考复习课程较重，基本未超前学习。, 会通过我每次课后布置的作业进行复习巩固, 考试的时候做题还是会因为马虎出错，导致不该丢的分丢了。, 中等难度及以下的题目做题速度和正确率都比较稳定，维持在比较好的水平。]', '[学生注意中午休息充足。我会改进上课方式，尽量既保证课堂的趣味性，也能把知识掌握扎实。, 学生在做题过程中应加强相同题型的总结归纳整理，建立错题集，分析错误原因，反复巩固。我也会在之后针对此类题型针对性的出一些复习题加强练习。最后还要对二次函数的所有知识点进行整体的复习。, 有时间可以稍微预习一下未学知识。在课堂任务提早完成的基础上，可以帮助学生超前学习。, 督促学生按照不同章节建立错题集，便于考试前有针对性地复习巩固。, 平时做题的时候就要认真审题，认真计算。不要随意省略必要的步骤。, 平时出现有技巧性的题目的时候就归纳总结技巧，加快计算速度。]');
