INSERT INTO suggestions VALUES ('d8eb035e-6f60-49c6-b371-88f3ce1c1292', '[专注度比刚开始上课时有了很大进步, 基础知识掌握较好，细节问题仍有不足, 主动预习较少, 复习巩固完成较好，布置的作业也能按时完成, 考试技巧掌握还不错，但考试态度仍需加强, 准确率基本较高，细节问题出错较多]', '[在之后的学习中从激发学生兴趣入手，提高听课专注度和效率, 细节问题与学习态度有很大关系，需要循序渐进, 之后会着重引导学生养成预习的习惯, 建议自己逐渐形成复习和做题的学习习惯, 相关应试技巧也会在后面的课程中进一步系统学习, 需要学生自身端正学习态度，才能在避免在细节上丢掉不该丢的分数]');
INSERT INTO suggestions VALUES ('9ab05ff2-6976-4d99-ba28-8d00e728249f', '[比之前有所进步，但上课专注度还需要提高, 基础知识较薄弱，直接影响作文的构思和写作, 因为主要补习的是作文，所以没有太多提前预习的要求, 复习意识较差，有时布置的作业可能因为平时时间关系不能完成, 作文技巧掌握相对较好, 常用汉字有很多错字和不会写的，准确率有点低]', '[希望能和家长一起努力，争取能够提高学生的学习兴趣，才能从根本上提高上课专注度, 在之后的学习中会有计划地给学生复习和巩固基础字词, 在之后的课程中主要帮助学生树立及时预习 复习的学习习惯, 希望能够和家长一起，督促学生及时复习，提高学习效率，合理利用时间, 在之后会系统为学生增强一下作文技巧, 在之后的课程中有计划地复习和巩固常用字词]');
INSERT INTO suggestions VALUES ('7df778c1-7c40-443f-824f-51aff74bf443', '[听课专注度有很大进步, 基础知识掌握很好，细节部分还需加强, 预习意识一般, 复习意识较好，布置的作业基本都能按时完成, 技巧掌握相对较好, 准确率较高，但仍有细节处丢分的现象]', '[希望能继续保持状态直到中考, 最后冲刺阶段着重查缺补漏, 希望以后能养成主动学习的习惯, 希望能形成习惯，在以后的学习中也坚持下去, 冲刺阶段会整体讲一下技巧问题, 正式考试中一定要放平心态，有条有理地答题]');
INSERT INTO suggestions VALUES ('8c0a3514-01b4-4e08-9db8-a2ea10166793', '[中间又两次课听课不太认真, 有进步, 一般, 一般, 有进步, 有进步]', '[后面我会较严格一些，希望学生上课能静下心来好好听, 希望学生能把握住知识要点, 希望学生能在上课前做好准备, 上课期间会准备与前面所学知识又交叉的内容，希望学生能在学习新知识的同时复习到前面的, 学生能较好地把握住考点, 大部分时间做题效率和质量很不错]');
INSERT INTO suggestions VALUES ('902491b8-8037-45bb-9e86-9971ba8f1b2d', '[比较认真, 基础较薄弱, 无, 无，, 技巧掌握还不够, 解题速度不快，准确率不高]', '[高效学习，踏实认真, 多做题，做笔记, 暂时不用, 提升学习兴趣，主动学习, 需要多做题，掌握学习方法, 多多练习]');
